import React from 'react';

import classes from './AddCar.module.css';

const AddCar = () => {
  return (
    <div className={classes['add-car']}>
      <div className={classes['add-car-form']}>
        <form onSubmit={submitHandler}>
          <div className={classes.control}>
            <Input
              id="brand"
              label="Brand"
              type="text"
              isValid={brandState.isValid}
              value={brandState.value}
              onChange={brandChangeHandler}
              className={`${classes.control} ${classes['add-car-brand']}`}
            />
          </div>
          <div className={classes.control}>
            <Input
              id="series"
              label="Series"
              type="text"
              isValid={seriesState.isValid}
              value={seriesState.value}
              onChange={seriesChangeHandler}
              className={`${classes.control} ${classes['add-car-series']}`}
            />
          </div>
          <div className={classes.control}>
            <Input
              id="model"
              label="Model"
              type="text"
              isValid={modelState.isValid}
              value={modelState.value}
              onChange={modelChangeHandler}
              className={`${classes.control} ${classes['add-car-model']}`}
            />
          </div>
          <div className={classes.control}>
            <Input
              id="year"
              label="Year"
              type="number"
              isValid={yearState.isValid}
              value={yearState.value}
              onChange={yearChangeHandler}
              className={`${classes.control} ${classes['add-car-year']}`}
            />
          </div>
          <div className={classes.control}>
            <Input
              id="engine"
              label="Engine"
              type="text"
              isValid={engineState.isValid}
              value={engineState.value}
              onChange={engineChangeHandler}
              className={`${classes.control} ${classes['add-car-engine']}`}
            />
          </div>
          <div className={classes.control}>
            <Input
              id="mileage"
              label="Mileage"
              type="number"
              isValid={mileageState.isValid}
              value={mileageState.value}
              onChange={mileageChangeHandler}
              className={`${classes.control} ${classes['service-mileage']}`}
            />
          </div>
          <div className={classes.actions}>
            <Button type="submit" className={classes.btn}>
              Add Car
            </Button>
          </div>
        </form>
      </div>
    </div>
  );
};

export default AddCar;
